import React from "react";
import Machine from "./Machine";
import './MG.css';

function MG(props) {
  const mgarray = props.mg.map((ele) => {
    return <div key={ele.id}>{`mg${ele.id}`}</div>;
  });

  return (
    <div className="MG">
      {mgarray}
      {props.mg.map((ele) => (
        <div key={ele.id} className="machinesWrapper" style={{ textAlign: "center" }}>
          <h4>{ele.name}</h4>
          <Machine machines={ele.machines} />
        </div>
      ))}
    </div>
  );
}

export default MG;
